import React, {Component} from 'react';
import './Birds.css'


class Birds extends Component {


    clickResult(item) {
        this.props.answerData(item)
    }
    clazz(item){
        const {data2} = this.props;
            if(item.id === data2){
                return 'success'
            }else{
                return 'error'
            }
    }

    render() {
        const {data} = this.props;
        return (
            <ul className="item-list list-group">
                {data.map((item) => (
                    <li className={`list-group-item ${this.clazz(item)}`} key={item.id} onClick={() => this.clickResult(item)}>
                      <span className={'li-btn'}>
                      </span>
                        {item.name}
                    </li>
                ))}
            </ul>
        );
    }
}

export default Birds;
